settings\u0004Note: To disable a context:
주의: 컨텍스트 메뉴 아이템을 비활성화 하려면 
다음을 복사하여 "사용자 개인 설정"에 "disabled" 키를 추가합니다. 
다음 예제는 파일에 대한 아이템 다운로드를 비활성화하는 예 입니다. 
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ".jp-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

컨텍스트 메뉴 설명:

settings\u0004Note: To disable a item,\n:
참고: 항목을 비활성화하려면
사용자 환경설정에 복사하고 "disabled" 키를 추가합니다.
다음 예는 사용자 메뉴를 비활성화하는 예입니다:
{
  "toolbar": [
    {
      "name": "user-menu",
      "disabled": true
    }
  ]
}

settings\u0004Note: To disable a menu or:
주의: 메뉴 혹은 메뉴 아이템을 비활성화 하려면, 
다음을 복사하여 사용자 개인 설정에 
"disabled" 키를 추가합니다. 
다음 예제는 "탭" 메뉴와 "Restart Kernel and Run up to Selected Cell" 
아이템을 비활성화 합니다:
{
  "menus": [
    {
      "id": "jp-mainmenu-tabs",
      "disabled": true
    },
    {
      "id": "jp-mainmenu-kernel",
      "items": [
        {
          "command": "notebook:restart-and-run-to-selected",
          "disabled": true
        }
      ]
    }
  ]
}

