settings\u0004Overrides default widget p:
애플리케이션 레이아웃에서 기본 위젯 위치를 재정의합니다.
예를 들어 오른쪽 사이드바에는 여러 문서 모드에서 터미널을 배치하고 아래쪽에는 단일 문서 모드에서 터미널을 배치합니다.
{
  "single": { "Terminal": { "area": "down" } },
  "multiple": { "Terminal": { "area": "right" } }
}.
